import React, { Component } from 'react'

import SHOP_DATA from './Shop.data'

export default class Shop extends Component {
    constructor(props) {
        super(props)
        this.state = {
            collections: SHOP_DATA
        }
    }

    render() {
        return (
            <div>
                SHOP PAGE
            </div>
        )
    }
}
